// src/TradingText.js
import React from "react";
import Typed from "react-typed";

const TradingText = () => {
  return (
    <div>
      <h1 className="text-white homepagetextshadow">
        Fueling the Next-Generation{" "}
        <Typed
          strings={[
            "Blockchain",
            "DeFi",
            "Web3",
            "Layer1",
            "Infrastructure",
            "GameFi",
            "NFT",
          ]}
          typeSpeed={40}
          backSpeed={50}
          loop
        />
        <br />
        Ecosystem
      </h1>
    </div>
  );
};

export default TradingText;
